// PDFDownloadButton.js
import React from "react";
import jsPDF from "jspdf";
import "jspdf-autotable";

const PDFDownloadButton = ({ data, columns, title }) => {
  const downloadPdfDocument = () => {
    const doc = new jsPDF();

    //Logo
    const logoBase64 =
      ""; // This should be the base64 string of your logo
    if (logoBase64) {
      doc.addImage(logoBase64, "PNG", 9, 5, 15, 10);
    }

    // Set font for the header text
    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);

    // Set text color to black or any other color you prefer
    doc.setTextColor(0, 0, 0);

    const pageWidth = doc.internal.pageSize.getWidth();
    const headerText = "www.devote.com";
    doc.text(headerText, pageWidth - 20, 10, { align: "right" });

    // Title
    doc.setFont("helvetica", "bold");
    doc.setFontSize(18);
    doc.setTextColor(140, 111, 253);

    const titleWidth = doc.getTextWidth(title);
    const pageCenter = doc.internal.pageSize.getWidth() / 2;

    doc.text(title, pageCenter, 22, { align: "center" });

    // Reset text color to black for the rest of the document
    doc.setTextColor(0, 0, 0);

    // Date
    doc.setFontSize(11);
    doc.setFont("helvetica", "normal");
    doc.text(`Report Time and Date: ${new Date().toLocaleString()}`, 14, 32);

    // Address - can be customized or removed as needed
    doc.setFontSize(11);
    doc.text("123 Riverside Dr", 14, 42);
    doc.text("Nairobi, Kenya", 14, 47);

    doc.setFontSize(11);
    doc.text("Tel: +254 123 456 789", 14, 52);
    doc.text("Email: support@devote.com", 14, 57);

    // Table
    doc.autoTable({
      startY: 72,
      head: [columns.map((column) => column.Header)],
      body: data.map((row) => columns.map((column) => row[column.accessor])),
      theme: "grid",
      headStyles: {
        fillColor: [140, 111, 253],
        textColor: [255, 255, 255],
        fontStyle: "bold",
      }, // Using #8c6dfd for the header
      bodyStyles: { fillColor: [255, 255, 255], textColor: [0, 0, 0] }, // White rows with dark text
      alternateRowStyles: { fillColor: [255, 255, 255] }, // Keeping alternate rows white for a clean look
      styles: {
        font: "helvetica",
        cellPadding: { top: 2, right: 4, bottom: 2, left: 4 },
      }, // Using Helvetica
    });

    // Footer
    doc.setFontSize(11);
    doc.text(
      "Thank you for using our services.",
      14,
      doc.lastAutoTable.finalY + 10
    );

    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);

    // Set text color back to black (if it was changed earlier)
    doc.setTextColor(0, 0, 0);

    const pageHeight = doc.internal.pageSize.getHeight();
    const footerText = "© www.devote.com";

    // Position the footer text at the bottom of the page
    // '20' is the margin from the bottom of the page, adjust as needed
    doc.text(footerText, 20, pageHeight - 10, { align: "left" });

    // Save the PDF
    doc.save(`${title}.pdf`);
  };

  return (
    <button
      onClick={downloadPdfDocument}
      className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
      style={{ margin: "10px 0", alignSelf: "start" }}
    >
      Download PDF
    </button>
  );
};

export default PDFDownloadButton;
